import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View , Button , TextInput } from 'react-native';

export default function App() {
  return (

    <View style ={{padding :50 }} >


      <View  >
      <TextInput placeholder="nom admin"/>
      </View>
      <View style ={{padding : 50}} >
      <TextInput placeholder="mot de pass" 
      style ={{width: 200 , flexDirection : 'row' , justifyContent :'space-evenly'}} 
      />

      </View>
       <View  style ={{padding: 50  , flexDirection : 'row' , justifyContent :'space-evenly'}} >
      <Button title="se connecter avec facebook" />
      </View>
      <View style ={{padding: 50 , flexDirection : 'row' , justifyContent : 'space-evenly'}} >
      <Button title="se connecter avec email " />
      </View>

    </View>
  );
}
